import React, { Fragment } from 'react';
import Cstyle from './Style/Clint-S';

class Clients extends React.Component {
    render() {
        return (
            <Fragment>
                <CStyle />
                <div className="clients">
                    HEAR FROM OUR CLIENTS...
                </div>
            </Fragment>
        )
    }
}
export default Clients;
